    }

    render() {
        return (
            <div className="container">
                <div className="row">
                    <label>
                        <b>Name:</b>
                    </label>
                    <input type="inputSignup" name="name"type="text"
                           value={this.state.name} onChange={this.changeNameHandler}/>
                </div>
                <div className="row">
                    <label>
                        <b>Pager Number:</b>
                    </label>
                    <input type="inputSignup" name="numPager" type="text"  value={this.state.numPager} onChange={this.changeNumPagerHandler}/>
                </div>
                <div className="row">
                    <label>
                        <b>Email:</b>
                    </label>
                    <input type="inputSignup" name="email" type="email"
                           value={this.state.email} onChange={this.changeEmailHandler}/>
                </div>
                <div className="row">
                    <label>
                        <b>Password:</b>
                    </label>
                    {/*// TODO: Add logic here to confirm passwords match*/}
                    <input type="inputSignup" name="password" type="password"
                           value={this.state.password} onChange={this.changePasswordHandler}/>
                </div>
                <div className="row">
                    <label>
                        <b>Confirm Password:</b>
                    </label>
                    {/*// TODO: Add logic here to confirm passwords match*/}
                    <input type="inputSignup" name="confirmPassword" type="password"
                           value={this.state.confirmPassword} onChange={this.changePasswordHandler}/>
                </div>
                <div className="row">
                    <label htmlFor="role">
                        <b>Role:</b>
                    </label>
                    <select name="role" name="role" id="role">
                        <option value="empty" onChange={this.changeRoleHandler}></option>
                        <option value="JuniorDoctor" onChange={this.changeRoleHandler}>FY</option>
                        <option value="SHO" onChange={this.changeRoleHandler}>SHO</option>
                        <option value="Consultant" onChange={this.changeRoleHandler}>Spr/Cons</option>
                    </select>
                    <div id="actionButtonsSignUp">
                        <button id="actionButtonSignUp" onClick={null}>
                            Return to login page
                        </button>
                        <button id="actionButtonSignUp" onClick={this.saveHospitalPerson}>Register</button>
                    </div>
                </div>
            </div>
        );
    }
}


export default CreateHospitalPerson;
